import {Switch} from '@material-ui/core';


const Nav = ({setDarkMode, darkMode}) => {
    return(
        <div className="p-1 flex w-screen 
                      dark:bg-slate-900 
                      dark:text-white 
                        justify-between">
            <h1 className="text-3xl text-slate-900 dark:text-slate-50">SKILLET</h1>
            <Switch 
                className="dark:bg-slate-900"
                color="primary"
                onChange={() => setDarkMode(!darkMode)}
            />
        </div>
    )
}

export default Nav;
